  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Pea Island
  National Wildlife Refuge summarizes Refuge activities during the 1982 calendar year.
  \ The report begins with a summary of the yearu2019s highlights and climatic conditions.
  \ Land acquisition is also covered.  The report includes a planning section which
  discusses the master plan, public participation, and compliance with environmental
  mandates.  Refuge administration is outlined; information about personnel, youth
  programs, volunteer programs, funding, safety, and technical assistance is given.
  \ Habitat management is also covered.  Subjects include wetlands, croplands, fire
  management, and wilderness areas.  The wildlife section of the report discusses
  wildlife diversity, endangered species, threatened species, waterfowl, marsh birds,
  water birds, shorebirds, raptors, game mammals, animal control, marking, and bird
  banding.  The public uses of the Refuge described in this report include outdoor
  classrooms, interpretive exhibits, fishing, wildlife observation, and law enforcement.
  \ The equipment and facilities section of the report provides information about
  rehabilitation, major maintenance, and communications systems.  Cooperative programs
  and items of interest are provided at the end.\",\n\t\"license_title\": \"License
